import '../App.css';

function Book(props){
    return(
        <div>
            <h2>책제목 : {props.title}</h2>
            <h4>저자</h4>
            <h5>가격</h5>
        </div>
    );
}

function App(){
    return(
        <div className="App">
            <Book title='자바'></Book>
            <Book title='파이썬'></Book>
            <Book title='리엑트'></Book>
        </div>
    );
}

export default App;
